void GetAdapterIPAddresses(const char* adapterName, vector<string>& ipAddresses)
{
    // Create a socket handle
    SOCKET s = WSASocket(AF_INET, SOCK_DGRAM, 0, 0, 0, 0);
    if (s == INVALID_SOCKET)
    {
        // Handle error
        return;
    }

    // Get adapter information
    IP_ADAPTER_INFO adapterInfo;
    DWORD dwRetVal = GetAdaptersInfo(AF_UNSPEC, 0, 0, &adapterInfo, sizeof(IP_ADAPTER_INFO));
    if (dwRetVal == ERROR_BUFFER_OVERFLOW)
    {
        // Buffer overflow, retry with larger buffer
        char* buffer = new char[dwRetVal];
        dwRetVal = GetAdaptersInfo(AF_UNSPEC, 0, 0, &adapterInfo, dwRetVal);
        if (dwRetVal == NO_ERROR)
        {
            // Copy adapter information to vector
            for (ULONG i = 0; i < adapterInfo.Length; i += sizeof(IP_ADAPTER_ADDRESSES))
            {
                IP_ADAPTER_ADDRESSES* pAddresses = (IP_ADAPTER_ADDRESSES*)&adapterInfo.FirstUnicastAddress;
                string ipAddress = inet_ntoa(*pAddresses->FirstUnicastAddress.lpAddress);
                ipAddresses.push_back(ipAddress);
            }
        }
        delete[] buffer;
    }
    else if (dwRetVal == NO_ERROR)
    {
        // Copy adapter information to vector
        for (ULONG i = 0; i < adapterInfo.Length; i += sizeof(IP_ADAPTER_ADDRESSES))
        {
            IP_ADAPTER_ADDRESSES* pAddresses = (IP_ADAPTER_ADDRESSES*)&adapterInfo.FirstUnicastAddress;
            string ipAddress = inet_ntoa(*pAddresses->FirstUnicastAddress.lpAddress);
            ipAddresses.push_back(ipAddress);
        }
    }
    else
    {
        // Handle error
    }

    // Close socket handle
    WSAClose(s, 0);
}

