    vector<string> ipAddresses;

    // Get a list of all adapters
    IP_ADAPTER_INFO* pAdapterInfo = nullptr;
    DWORD dwRetVal = GetAdaptersInfo(AF_UNSPEC, 0, 0, &pAdapterInfo, 0);
    if (dwRetVal == NO_ERROR)
    {
        // Iterate over adapters and retrieve IP addresses
        for (ULONG i = 0; i < pAdapterInfo->Length; i += sizeof(IP_ADAPTER_INFO))
        {
            IP_ADAPTER_INFO* pCurrentAdapter = (IP_ADAPTER_INFO*)&pAdapterInfo[i];
            string adapterName = pCurrentAdapter->AdapterName;
            vector<string> tempIpAddresses;
            GetAdapterIPAddresses(adapterName.c_str(), tempIpAddresses);
            ipAddresses.insert(ipAddresses.end(), tempIpAddresses.begin(), tempIpAddresses.end());
        }
    }
    else
